webpackJsonp([0xeb161175c565],{373:function(a,e){a.exports={data:{markdownRemark:{html:'<p>I recently logged into my <a href="https://itunes.apple.com/us/app/arrow-card/id1228440036?mt=8">Arrow Card iOS app</a> to check my balance and was pumped to discover that my team\'s Spring 2017 Hackathon project branch was finally merged and released.</p>\n<p>Here it is, in all its cartoon-y glory: the <a href="https://www.lendup.com/education">LendUp Education</a> mobile feature.</p>\n<p><img src="/arrow-b39f5b1ad908be82cc36f75cdb72181a.gif" alt="app"></p>\n<p><a href="https://www.lendup.com/card">Arrow Card</a> holders can watch educational videos about improving their credit scores, budgeting, saving, and other personal finance tidbits, followed by a quick multiple choice quiz, followed by CONFETTI üéâ:</p>\n<p><img src="/confetti-8e120d7dabb838511c9b16e0d40509dd.gif" alt="app"></p>\n<p>Pooja, Ray, Lise, and I built this cute little feature in a little less than a day, thanks to the power and glory and ergonomic bliss of <a href="https://facebook.github.io/react-native/">React Native</a>. Now it\'s one of the top-billed features in the app. </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-0f46e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 29.771689497716896%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="features"\n        title=""\n        src="/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-4f122.png"\n        srcset="/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-36be4.png 163w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-c9624.png 325w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-4f122.png 650w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-da6d5.png 975w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-92078.png 1300w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-47309.png 1950w,\n/static/features-ba34c1a3383b41fadc198bb71ea6f2a4-0f46e.png 2190w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I wonder what else we could have built for the Arrow Card app if we were just allowed to make stuff more independently.</p>\n<p>Also, somehow, we lost the hackathon to a chatbot project. I\'m not <em>that</em> bitter. I definitely would have enjoyed the taste of victory (and some of that oh-so-comfy LendUp hackaday winner swag), but at least our feature got released üôè.</p>',frontmatter:{date:"17 June 2018",path:"/lendup-hackathon-project-lives-on",title:"LendUp Hackathon Project Lives On",author:"Charles Harrington",category:"Coding"}}},pathContext:{}}}});
